import React, { Component } from "react";
import Players from "./players";
import DayPicker from "./common/date-picker";

class Games extends Component {
  state = {
    players: [
      { id: 1, name: "Bibs" },
      { id: 2, name: "Vasili" },
      { id: 3, name: "Rami" },
      { id: 4, name: "Asad" },
    ],
  };

  render() {
    const { players } = this.state;

    return (
      <div>
        <Players players={players} />
        <DayPicker />
      </div>
    );
  }
}

export default Games;
